package com.springcore.Q11;

public class Student {
	String sname;
	int rollNo;
	String dob;
	String classname;
	String section;
	Result result;
	public Student() {
		super();
		// TODO Auto-generated constructor stub
	}
	public Student(String sname, int rollNo, String dob, String classname, String section, Result result) {
		super();
		this.sname = sname;
		this.rollNo = rollNo;
		this.dob = dob;
		this.classname = classname;
		this.section = section;
		this.result = result;
	}


	
	
	

}
